- Ontology:
  - rdfs:comment:
    - ontology_comment: string
- TransitiveProperty:
  - rdfs:subPropertyOf:
    - transitive_property_sub_property_of: ObjectProperty
  - owl:inverseOf:
    - transitive_property_inverse_of:
      - AsymmetricProperty
      - ObjectProperty
      - TransitiveProperty
  - rdfs:domain:
    - transitive_property_domain: Class
  - rdfs:range:
    - transitive_property_range: Class
- ObjectProperty:
  - rdfs:subPropertyOf:
    - object_property_sub_property_of: ObjectProperty
  - owl:inverseOf:
    - object_property_inverse_of:
      - TransitiveProperty
      - AsymmetricProperty
      - ObjectProperty
  - rdfs:domain:
    - object_property_domain: Class
  - rdfs:range:
    - object_property_range: Class
- Class:
  - owl:equivalentClass:
    - class_equivalent_class: Class
  - rdfs:subClassOf:
    - class_sub_class_of: Class
  - ns1:prefixIRI:
    - class_prefix_iri: string
- AsymmetricProperty:
  - rdfs:subPropertyOf:
    - asymmetric_property_sub_property_of: ObjectProperty
  - owl:inverseOf:
    - asymmetric_property_inverse_of:
      - ObjectProperty
      - AsymmetricProperty
      - TransitiveProperty
  - rdfs:domain:
    - asymmetric_property_domain: Class
  - rdfs:range:
    - asymmetric_property_range: Class
- AnnotationProperty:
  - rdfs:subPropertyOf:
    - annotation_property_sub_property_of: AnnotationProperty
  - rdfs:domain:
    - annotation_property_domain: Class
